            asteroids: "<p><strong>ASTEROIDS</strong></p><p>A few of the solar system&rsquo;s <strong>millions of asteroids</strong> will swing close to Earth over the next 150 years. None will hit us. Nevertheless, every time a large one goes by, a <strong>scare story will flare up</strong>&hellip;",
            "bird-flu": "<p><strong>BIRD FLU</strong></p><p>A terrible disease with a very high fatality rate (58%) but <strong>very low contagiousness</strong>.</p><p>Direct contact with infected birds is needed for infection. <strong>Human-to-human spread is rare</strong>.</p><p>Fear-spreading about this disease, however, is high.</p>", ebola: "<p><strong>EBOLA</strong></p><p>The largest outbreak to date -  in West Africa - peaked in Oct 2014 and provoked an <strong>unprecedented fear frenzy</strong> in the global media, panicking governments.</p><p>On the plus side, this mass attention accelerated the development of a potentially effective Ebola vaccine.</p>",
